Accounts_CustomFields_Description:
Powinien to być prawidłowy JSON, w którym kluczami są nazwy pól zawierające słownik ustawień pól. Przykład:<br/><code>{
"rola": {
"type": "select",
"defaultValue": "student",
"options": ["teacher", "student"],
"wymagany": prawdziwy,
"modifyRecordField": {
"tablica": prawda,
"pole": "role"
}
},
"twitter": {
"Wpisz tekst",
"wymagany": prawdziwy,
"minLength": 2,
"maxLength": 10
}
}</code>

Custom_Translations_Description:
Powinien to być prawidłowy JSON, w którym klucze są językami zawierającymi słownik klucza i tłumaczenia. Przykład:<br/><code>{
"en": {
"Kanały": "Pokoje"
},
"pt": {
"Kanały": "Salas"
}
}</code>
